import React from "react";
import CalWrapper from "../CalWrapper/CalWrapper";

const Cal = () => {

    const allBtArr = [
        {
            value: 0,
            btFun: ()=>{
                console.log(0);
            }
        },
        {
            value: 1,
            btFun: ()=>{
                console.log(0);
            }
        },
        {
            value: 0,
            btFun: ()=>{
                console.log(0);
            }
        },
        {
            value: 0,
            btFun: ()=>{
                console.log(0);
            }
        }
    ]


  return (
    <div>
      <p>This is Cal</p>
      <CalWrapper allBtArr={allBtArr}/>
    </div>
  );
};

export default Cal;
